import React from "react";
import Layout from "../components/layout/Layout";
import client from "../client";
import groq from "groq";

const App = ({ posts }) => {
  return (
    <Layout>
      <div>Hello</div>
    </Layout>
  );
};

App.getInitialProps = async () => ({
  posts: await client.fetch(groq`
      *[_type == "post"]|order(publishedAt desc)
    `),
});

export default App;
